$(function() {
    function f(l) {
        var k = 0;
        $(l).each(function() {
            k += $(this).outerWidth(true);
        });
        return k;
    }
    function g(n) {
        var o = f($(n).prevAll()), q = f($(n).nextAll());
        var l = f($(".content-tabs").children().not(".J_menuTabs"));
        var k = $(".content-tabs").outerWidth(true) - l;
        var p = 0;
        if ($(".page-tabs-content").outerWidth() < k) {
            p = 0;
        } else {
            if (q <= k - $(n).outerWidth(true) - $(n).next().outerWidth(true)) {
                if (k - $(n).next().outerWidth(true) > q) {
                    p = o;
                    var m = n;
                    while (p - $(m).outerWidth() > $(".page-tabs-content").outerWidth() - k) {
                        p -= $(m).prev().outerWidth();
                        m = $(m).prev();
                    }
                }
            } else {
                if (o > k - $(n).outerWidth(true) - $(n).prev().outerWidth(true)) {
                    p = o - $(n).prev().outerWidth(true);
                }
            }
        }
        $(".page-tabs-content").animate({
            marginLeft:0 - p + "px"
        }, "fast");
    }
    function a() {
        var o = Math.abs(parseInt($(".page-tabs-content").css("margin-left")));
        var l = f($(".content-tabs").children().not(".J_menuTabs"));
        var k = $(".content-tabs").outerWidth(true) - l;
        var p = 0;
        if ($(".page-tabs-content").width() < k) {
            return false;
        } else {
            var m = $(".J_menuTab:first");
            var n = 0;
            while (n + $(m).outerWidth(true) <= o) {
                n += $(m).outerWidth(true);
                m = $(m).next();
            }
            n = 0;
            if (f($(m).prevAll()) > k) {
                while (n + $(m).outerWidth(true) < k && m.length > 0) {
                    n += $(m).outerWidth(true);
                    m = $(m).prev();
                }
                p = f($(m).prevAll());
            }
        }
        $(".page-tabs-content").animate({
            marginLeft:0 - p + "px"
        }, "fast");
    }
    function b() {
        var o = Math.abs(parseInt($(".page-tabs-content").css("margin-left")));
        var l = f($(".content-tabs").children().not(".J_menuTabs"));
        var k = $(".content-tabs").outerWidth(true) - l;
        var p = 0;
        if ($(".page-tabs-content").width() < k) {
            return false;
        } else {
            var m = $(".J_menuTab:first");
            var n = 0;
            while (n + $(m).outerWidth(true) <= o) {
                n += $(m).outerWidth(true);
                m = $(m).next();
            }
            n = 0;
            while (n + $(m).outerWidth(true) < k && m.length > 0) {
                n += $(m).outerWidth(true);
                m = $(m).next();
            }
            p = f($(m).prevAll());
            if (p > 0) {
                $(".page-tabs-content").animate({
                    marginLeft:0 - p + "px"
                }, "fast");
            }
        }
    }
    $(".J_menuItem").each(function(k) {
        if (!$(this).attr("data-index")) {
            $(this).attr("data-index", k);
        }
    });
    function c() {
        var o = $(this).attr("href"), m = $(this).data("index"), l = $.trim($(this).text()), k = true;
        if (o == undefined || $.trim(o).length == 0) {
            return false;
        }
        var that=this;
        $(".J_menuTab").each(function() {
            if ($(this).data("id") == o) {
                if (!$(this).hasClass("active")) {
                    $(this).addClass("active").siblings(".J_menuTab").removeClass("active");
                    g(this);
                    $(".J_mainContent .J_iframe").each(function() {
                        if ($(this).data("id") == o) {
                        	$(".J_menuItem").removeClass("active");
		                	$(that).addClass("active");
                        	var list=$(this).attr("data-child");
		                	var arr=list?(list.split(',')):[];
		                	if(arr.length>0){
		                		$.each(arr,function(i,e){
		                			console.log(i,e)
		                			$('#'+e).remove();
		                		});
		                		$(this).attr("data-child",'');
		                	}
                            $(this).show().siblings(".J_iframe").hide();
                            return false;
                        }
                    });
                }
                k = false;
                return false;
            }
        });
        if (k) {
        	var bg='<div class="wrapper wrapper-content animated fadeInRight" id="loading" style="height:100%"><div class="ibox float-e-margins" style="height:100%"><div class="ibox-content text-center p-md" style="height:100%"><div class="spinner"><div class="spinner-container container1"><div class="circle1"></div><div class="circle2"></div><div class="circle3"></div><div class="circle4"></div></div><div class="spinner-container container2"><div class="circle1"></div><div class="circle2"></div><div class="circle3"></div><div class="circle4"></div></div><div class="spinner-container container3"><div class="circle1"></div><div class="circle2"></div><div class="circle3"></div><div class="circle4"></div></div></div></div></div></div>'
            $('#content-main').append(bg);
            var p = '<a href="javascript:;" class="active J_menuTab" data-id="' + o + '">' + l + ' <i class="fa fa-times-circle"></i></a>';
            $(".J_menuTab").removeClass("active");
            //var iframeElem = '<iframe class="J_iframe" name="iframe' + m + '" width="100%" height="100%" src="' + o + '" frameborder="0" data-id="' + o + '" seamless></iframe>';
            var iframeElem = document.createElement("iframe");
			iframeElem.src = o;
			iframeElem.setAttribute('class','J_iframe');
			iframeElem.name='iframe'+ m;
			iframeElem.width='100%';
			iframeElem.height='100%';
			iframeElem.setAttribute('frameborder','0');
			iframeElem.setAttribute('data-id',o);
			iframeElem.setAttribute('seamless',true);

			if (iframeElem.attachEvent){
			    iframeElem.attachEvent("onload", function(){
			    	$('#loading').remove();
			    });
			} else {
			    iframeElem.onload = function(){
			    	$('#loading').remove();
			    };
			}
            $(".J_mainContent").find("iframe.J_iframe").hide().parents(".J_mainContent").append(iframeElem);
            $(".J_menuTabs .page-tabs-content").append(p);
            g($(".J_menuTab.active"));
        }
        return false;
    }
    $(".J_menuItem").on("click", c);
    function h() {
        var m = $(this).parents(".J_menuTab").data("id");
        var l = $(this).parents(".J_menuTab").width();
        if ($(this).parents(".J_menuTab").hasClass("active")) {
            if ($(this).parents(".J_menuTab").next(".J_menuTab").size()) {
                var k = $(this).parents(".J_menuTab").next(".J_menuTab:eq(0)").data("id");
                $(this).parents(".J_menuTab").next(".J_menuTab:eq(0)").addClass("active");
                $(".J_mainContent .J_iframe").each(function() {
                    if ($(this).data("id") == k) {
                        $(this).show().siblings(".J_iframe").hide();
                        return false;
                    }
                });
                var n = parseInt($(".page-tabs-content").css("margin-left"));
                if (n < 0) {
                    $(".page-tabs-content").animate({
                        marginLeft:n + l + "px"
                    }, "fast");
                }
                $(this).parents(".J_menuTab").remove();
                $(".J_mainContent .J_iframe").each(function() {
                    if ($(this).data("id") == m) {
                        $(this).remove();
                        return false;
                    }
                });
            }
            if ($(this).parents(".J_menuTab").prev(".J_menuTab").size()) {
                var k = $(this).parents(".J_menuTab").prev(".J_menuTab:last").data("id");
                $(this).parents(".J_menuTab").prev(".J_menuTab:last").addClass("active");
                $(".J_mainContent .J_iframe").each(function() {
                    if ($(this).data("id") == k) {
                        $(this).show().siblings(".J_iframe").hide();
                        return false;
                    }
                });
                $(this).parents(".J_menuTab").remove();
                $(".J_mainContent .J_iframe").each(function() {
                    if ($(this).data("id") == m) {
                        $(this).remove();
                        return false;
                    }
                });
            }
        } else {
            $(this).parents(".J_menuTab").remove();
            $(".J_mainContent .J_iframe").each(function() {
                if ($(this).data("id") == m) {
                    $(this).remove();
                    return false;
                }
            });
            g($(".J_menuTab.active"));
        }
        return false;
    }
    $(".J_menuTabs").on("click", ".J_menuTab i", h);
    function i() {
        $(".page-tabs-content").children("[data-id]").not(":first").not(".active").each(function() {
            $('.J_iframe[data-id="' + $(this).data("id") + '"]').remove();
            $(this).remove();
        });
        $(".page-tabs-content").css("margin-left", "0");
    }
    $(".J_tabCloseOther").on("click", i);
    function j() {
        g($(".J_menuTab.active"));
    }
    $(".J_tabShowActive").on("click", j);
    function e() {
    	var that=this;
        if (!$(this).hasClass("active")) {
            var k = $(this).data("id");
            $(".J_mainContent .J_iframe").each(function() {
                if ($(this).data("id") == k) {
                	var list=$(this).attr("data-child");
                	var arr=list?(list.split(',')):[];
                	if(arr.length>0){
                		$('#'+arr[(arr.length-1)]).show().siblings(".J_iframe").hide();
                	}else{
                		$(this).show().siblings(".J_iframe").hide();
                	}
                	$(".J_menuItem").removeClass("active");
                	$('.J_menuItem').each(function(i,e){
                		if($(e).attr('href')==$(that).attr("data-id")){
                			$(e).addClass("active");
                		}
                	});
                    
                    return false;
                }
            });
            $(this).addClass("active").siblings(".J_menuTab").removeClass("active");
            g(this);
        }
    }
    $(".J_menuTabs").on("click", ".J_menuTab", e);
    function d() {
        var l = $('.J_iframe[data-id="' + $(this).data("id") + '"]');
        var k = l.attr("src");
    }
    $(".J_menuTabs").on("dblclick", ".J_menuTab", d);
    $(".J_tabLeft").on("click", a);
    $(".J_tabRight").on("click", b);
    $(".J_tabCloseAll").on("click", function() {
        $(".page-tabs-content").children("[data-id]").not(":first").each(function() {
            $('.J_iframe[data-id="' + $(this).data("id") + '"]').remove();
            $(this).remove();
        });
        $(".page-tabs-content").children("[data-id]:first").each(function() {
            $('.J_iframe[data-id="' + $(this).data("id") + '"]').show();
            $(this).addClass("active");
        });
        $(".page-tabs-content").css("margin-left", "0");
    });

    var addActive=function(str,o,id,name,dataList){
    	var m = $(this).data("index");
    	var iframeElem = document.createElement("iframe");
    	iframeElem.src = o;
    	iframeElem.setAttribute('class','J_iframe');
    	iframeElem.name=name;
    	iframeElem.width='100%';
    	iframeElem.height='100%';
    	iframeElem.setAttribute('frameborder','0');
    	iframeElem.setAttribute('data-id',str);
    	iframeElem.setAttribute('seamless',true);
    	iframeElem.setAttribute('id',id);


    	if (iframeElem.attachEvent){
    		iframeElem.attachEvent("onload", function(){
    			$('#loading').remove();
    		});
    	} else {
    		iframeElem.onload = function(){
    			$('#loading').remove();
    		};
    	}
    	$(window.parent.document).find(".J_mainContent").find("iframe.J_iframe").hide().parents(".J_mainContent").append(iframeElem);

    	iframeElem.contentWindow['iframeData']=dataList;
	};
	window.addActive=addActive;

	var removeActive=function(id,fn,name,data){
		var s=$(window.parent.document).find(id).attr('data-id');
        var a=(new Function('return '+s))();
        var arr=($(window.parent.document)[0]).getElementsByTagName("iframe");
        var iframeFn=null;
        for(var i=0,l=arr.length;i<l;i++){
            if($(arr[i]).attr('data-id')==a[(a.length-1)]){
                var o=$(arr[i]);
                var list=o.attr('data-child');
                var listArr=list.split(',');
                if(listArr.length==1){
                    $(arr[i]).show().attr('data-child','');
                }else{
                    listArr.pop();
                    $(arr[i]).show().attr('data-child',listArr.join(','));
                }    
            }

            if($(arr[i]).attr('data-id')==('./'+name+'.html')){
            	iframeFn=(($(arr[i]))[0]).contentWindow[fn];
            }
        }
        iframeFn&&iframeFn.call(this,data);
        $(window.parent.document).find(id).html('');
        $(window.parent.document).find(id).remove();
	}
	window.removeActive=removeActive;
});



